import "./template.css";

type Props = {
  rows: number;
  columns: number;
};

const Template: React.FC<Props> = ({ rows, columns }) => {
  const grid = rows * columns;

  const date = new Date("December 14, 2026 07:30:00");
  const hoursAndMinutes = date.getHours() + ":" + date.getMinutes();

  console.log(hoursAndMinutes)

  function addHousr(hours = 1) {  
    const addedHours = new Date(date.getTime() + hours * 3600 * 1000);
    return addedHours.getHours() + ":" + addedHours.getMinutes();
  }
  

  return (
    <div className="template">
      {[...Array(grid)].map(() => {
        return <div className="cell"></div>;
      })}
    </div>
  );
};

export default Template;
